Matter before the Court for Plea/sentencing.  Hearing proceeded.  Negotiations set forth by the state.

COUNT 3:  The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights and Addendum to Plea Questionnaire, received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

COUNT 2:  Pursuant to plea negotiations and on the state's motion, the Court ordered Count 1 DISMISSED AND READ-IN for the purpose of sentencing in Count 3.

Statements made as to sentencing by the state, defense, and defendant.

The Court sentenced defendant to serve 90 DAYS in the House of Correction with 0 days credit, concurrent with 13CM002835/consecutive to any other sentence.  Huber release for employment and child care.

Court STAYED this sentence and placed the defendant on PROBATION for a period of 12 MONTHS with the following conditions:

-Defendant to pay court costs and all applicable surcharges and assessments within 1 year; any balance to convert to civil judgment;
-Defendant is to provide a DNA sample and pay the related surcharge within 1 year; any balance to convert to civil judgment;
-Absolute sobriety with random urine screens and cooperate with any department of corrections testing;
-No alcohol or drugs, no medication or controlled substances unless prescribed by a treating physician;
-Continue with treatment at West Milwaukee Comprehensive Treatment Center;

Defendant advised of her right to appeal this sentence.

Case set for Review Hearing on 4-07-16 at 1:30 p.m. before Branch 31.
